    <BrowserRouter>
      {/* <Provider> */}
        <Routes>
          <Route path="/" element={ <Navigate to="/login"/> } />
          <Route path="/login" element={ < Login /> } />
        </Routes>
      {/* </Provider> */}
    </BrowserRouter>
  );
}

export default App;
